private void runTest(Directory dir) throws Exception {
  // Run for ~1 seconds
  final long stopTime = System.currentTimeMillis() + 1000;

  SnapshotDeletionPolicy dp = new SnapshotDeletionPolicy(new KeepOnlyLastCommitDeletionPolicy());
  final IndexWriter writer = new IndexWriter(dir, new StandardAnalyzer(org.apache.lucene.util.Version.LUCENE_CURRENT), dp, IndexWriter.MaxFieldLength.UNLIMITED);

  // Force frequent flushes
  writer.setMaxBufferedDocs(2);

  final Thread t = new Thread() {
      @Override
      public void run() {
        Document doc = new Document();
        doc.add(new Field("content", "aaa", Field.Store.YES, Field.Index.ANALYZED, Field.TermVector.WITH_POSITIONS_OFFSETS));
        do {
          for(int i=0;i<27;i++) {
            try {
              writer.addDocument(doc);
            } catch (Throwable t) {
              t.printStackTrace(System.out);
              fail("addDocument failed");
            }
            if (i%2 == 0) {
              try {
                writer.commit();
              } catch (Exception e) {
                throw new RuntimeException(e);
              }
            }
          }
          try {
            Thread.sleep(1);
          } catch (InterruptedException ie) {
            throw new ThreadInterruptedException(ie);
          }
        } while(System.currentTimeMillis() < stopTime);
      }
    };

  t.start();

  // While the above indexing thread is running, take many
  // backups:
  do {
    backupIndex(dir, dp);
    Thread.sleep(20);
  } while(t.isAlive());

  t.join();

  // Add one more document to force writer to commit a
  // final segment, so deletion policy has a chance to
  // delete again:
  Document doc = new Document();
  doc.add(new Field("content", "aaa", Field.Store.YES, Field.Index.ANALYZED, Field.TermVector.WITH_POSITIONS_OFFSETS));
  writer.addDocument(doc);

  // Make sure we don't have any leftover files in the
  // directory:
  writer.close();
  TestIndexWriter.assertNoUnreferencedFiles(dir, "some files were not deleted but should have been");
}

